import React from 'react';


function ExpenseCard({amount, category,detail,date}){

    return (
        <div>
            <h6>{category}</h6>
            <p>Amount: ${amount}</p>
            <p>Detail: {detail}</p>
            <p>Date: {date}</p>
        </div>
    )

}

export default ExpenseCard;
